import { test } from '@/api/api';
import $ from 'jquery';
import axios from 'axios';
export default {
  name: "api-form",
  data: function data() {
    return {
      radio: ""
    };
  },
  methods: {
    handleDelApi: function handleDelApi() {
      var _this = this;

      this.$confirm('确认删除该接口吗?', '提示', {
        type: 'warning'
      }).then(function () {
        //NProgress.start();
        var self = _this;
        var params = JSON.stringify({
          project_id: Number(_this.$route.params.project_id),
          ids: [_this.$route.params.api_id]
        });
        var headers = {
          "Content-Type": "application/json",
          "Authorization": 'Token ' + JSON.parse(sessionStorage.getItem('token'))
        };
        axios.post(test + "/api/api/del_api", params, {
          headers: headers
        }).then(function (response) {
          if (response.data.code === '999999') {
            self.$message({
              message: '删除成功',
              center: true,
              type: 'success'
            });
            self.$router.push({
              name: '接口列表',
              params: {
                project_id: self.$route.params.project_id
              }
            });
          } else {
            self.$message.error({
              message: response.data.msg,
              center: true
            });
          }
        }).catch(function (error) {});
      }).catch(function () {});
    },
    showNavi: function showNavi(title) {
      this.radio = title;
    }
  },
  mounted: function mounted() {
    this.radio = this.$route.name;
  }
};
